pub fn get_mysql_root_grammar_id() -> GrammarId {
    GrammarId(2314)
}
pub fn get_mysql_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_mysql_root_grammar_id(),
        tables: &MYSQL_TABLES,
    }
}
pub fn get_mysql_root_grammar() -> RootGrammar {
    get_mysql_root_grammar_table()
}
